import React, { useEffect, useState } from 'react';

const UserDashboard = () => {
  const [dashboardHTML, setDashboardHTML] = useState('');

  useEffect(() => {
    // Load UserDashboard HTML content dynamically
    fetch('/templates/UserDashboard.html')
      .then(response => response.text())
      .then(html => setDashboardHTML(html))
      .catch(error => console.error('Error loading UserDashboard:', error));
  }, []);

  return (
    <div dangerouslySetInnerHTML={{ __html: dashboardHTML }} />
  );
};

export default UserDashboard;
